  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains a summary of research
  conducted at Neal Smith National Wildlife Refuge.  Research at Neal Smith has resulted
  in the publication of over 60 peer-reviewed scientific journal articles, 25 Masters
  theses and Ph.D. dissertations, 60 technical research reports,  and conservation
  and re-introduction of rare and declining grassland species.  Research topics have
  included planting methods for prairie reconstruction, ecological function of prairie
  planting, sedge meadow reconstruction, control of invasive plants, strategic herbicide
  use, Regal Frittilary butterfly reintroduction, grassland birds, invertebrates,
  soil carbon sequestration, hydrologic changes, groundwater dynamics, plant community
  interactions, alternative agricultural practices, bison and elk diet, effectiveness
  of environmental education programs, and Indiana bats.  Abstracts are provided for
  thirteen different research projects.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
